import React from "react";
import Logo from "../images/HigherEducationLogo.png";
import Header2 from "../components/Header2";

function HomePage(){

    return(
        <div className="w-full h-screen pt-60 ">
           <img className="m-auto w-60" src={Logo} />
           <div>{Header2}</div>
        </div>
    )
}

export default HomePage;
